import React from 'react';
import './Form.css'

function Form() {
    return (
        <div className="FormWrapper">
            <label className="Nome">Nome</label>
            <input type="text" />
            <label className="Email">Email</label>
            <input type="email" />
            <label className="Whats">WhatsApp</label>
            <input type="text" name="Whats" id="whats_id" />
            <div className="Checkbox">
                <input className="checkbox-redondo" type="checkbox" name="Autorizacao" id="autorizacao_id" />
                <label >Eu atorizo um consutor da Smile entrar em contato comigo via WhatsApp.</label>
            </div>
            <button >ENVIAR</button>
        </div>
    )
}

export default Form;
